// index.js or App.js

import React from 'react';
import ReactDOM from 'react-dom';
import AppRoutes from './AppRoutes';
import { Routes, BrowserRouter, Route} from 'react-router-dom';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <AppRoutes/>

      </Routes>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
